The use of “load management” is now huge in professional sports, but with baseball, it gets very tricky because of the tremendous range of variability in output a player can have from one game to the next.

One game they could walk 3 times and pop up to the infield and not get a ball hit to them and the next could be action packed in the field and base paths.

We discuss this and much more with Eric Cressey, Performance Director for the New York Yankees on the latest podcast. 

